import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// react components for routing our app without refresh
// import Link from "next/link";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import Footer from "components/Footer/Footer.js";
// @material-ui/icons
// core components
import Header from "../components/Header/Header.js";
import HeaderLinks from "../components/Header/HeaderLinks.js";
import styles from "assets/jss/nextjs-material-kit/pages/components.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import Button from "components/CustomButtons/Button.js";
import Search from "@material-ui/icons/Search";
import TextField from "@material-ui/core/TextField";
// import Parallax from "components/Parallax/Parallax.js";

const useStyles = makeStyles(styles);
// #7b7afa,#815ee5,#7057c0,#6350a6,#594991
export default function Components(props) {
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div>
      <Header
        brand="ANONMAS TH"
        rightLinks={<HeaderLinks />}
        fixed
        color="dark"
        changeColorOnScroll={{
          height: 400,
          color: "white"
        }}
        {...rest}
      />
      <div className={classNames(classes.main, classes.mainRaised)}>
        <GridContainer>
          <GridItem>
            <div className={classes.container} style={{ paddingTop: "10vh" }}>
              <div>
                <TextField
                  id="filled-textarea"
                  label="Multiline Placeholder"
                  placeholder="Placeholder"
                  multiline
                  variant="filled"
                />
                <Button justIcon round color="white">
                  <Search className={classes.searchIcon} />
                </Button>
              </div>
              <div id="buttons">
                <div className={classes.title}>
                  <h3>
                    <small>GOGO</small>
                  </h3>
                </div>
              </div>
            </div>

            <div>
              <h1>h1. NextJS Material Kit heading</h1>
              <h2>h2. NextJS Material Kit heading</h2>
              <h3>h3. NextJS Material Kit heading</h3>
              <h4>h4. NextJS Material Kit heading</h4>
              <h5>h5. NextJS Material Kit heading</h5>
              <h6>h6. NextJS Material Kit heading</h6>
              <h2>
                Header with small subtitle
                <br />
                <small>Use &lt;small&gt; tag for the headers</small>
              </h2>
            </div>
          </GridItem>
        </GridContainer>
      </div>
      <Footer />
    </div>
  );
}
